    info: "<p>&lsquo;Still I Rise&rsquo; &ndash; these are the words emblazoned across the back of Lewis Hamilton&rsquo;s helmet and tattooed across his shoulders, and ever since annihilating expectations with one of the greatest rookie performances in F1 history in 2007, that&rsquo;s literally all he&rsquo;s done: risen to the top of the all-time pole positions list ahead of his hero Ayrton Senna, surged into second place in the wins column behind only the inimitable Michael Schumacher, and surpassed the legendary Sir Jackie Stewart for the most championship titles by a British driver.</p>" + "<p>Could he be the G.O.A.T?&nbsp;Few would deny that he&rsquo;s in the conversation &ndash; and what&rsquo;s more he&rsquo;s got there his way, twinning his relentless speed with a refusal to conform to stereotypes for how a racing driver should think, dress or behave.</p>" + "<p>Respect is hard earned in F1, but Hamilton has it from every one of his peers.&nbsp;Why?&nbsp;Because they know that whatever the track, whatever the conditions, whatever the situation, when his visor goes down and the lights go out, it&rsquo;s Hammertime.</p>" + "<p> &nbsp;&ndash;  .      1993 ,    8             .  1998     Super One             ,       -1,        ,      -1.</p>" + "<p>     :   ( 1999), - ( 2000)     ( 2001),   2000    .  2001  2003       - UK,   2003  .   2004 -    McLaren    ,         ,        1  Williams   2004,  BMW   .        2004    -3   Manor,  2005   ASM      .  Autosport    24    &laquo;-50  2005&raquo;.  2006     GP2,         .</p>" + "<p>  2006        1  30         ,     .   2007     1,           ,          (109 )       .  ,  FIA         Williams  Sauber,      ,           2007,  ,               <em> </em>.</p>" + "<p>  2008,     - ,   ,      ,         .                 ,       .  2009-2012      ,      ,     4-5 .   2012           Mercedes,  ,    ,       ,    2013      .  2014-2015          Mercedes.  2016    ,   2017    !</p>"
